function onCastSpell(creature, variant)
	local player = Player(creature)
	if not player then
		return true
	end
 
	local playerVocation = player:getVocation():getId()
	local haveTransform = Trans[playerVocation]
	local getPosition = player:getPosition()
 
	if not haveTransform then
		player:sendCancelMessage("You have maximum power!")
		getPosition:sendMagicEffect(3)
		return true
	end
 
	if player:getLevel() < haveTransform.level then
		player:sendCancelMessage("You need "..haveTransform.level.." level to transform!")
		getPosition:sendMagicEffect(3)
		return true
	end
	
	if haveTransform.needQuest > 0 then
		if player:getStorageValue(haveTransform.needQuest) == -1 then
			player:sendCancelMessage("You need release quest!")
			getPosition:sendMagicEffect(3)
			return true
		end
	end
	
	player:addSkill(SKILL_FISHING, haveTransform.addDmg)
	player:setOutfit({lookType=haveTransform.nLookType})
	player:setMaxHealth(player:getBaseMaxHealth() + haveTransform.addHp)
	player:setMaxMana(player:getBaseMaxMana() + haveTransform.addKi)		
	player:setVocation(haveTransform.newVoc)
	getPosition:sendMagicEffect(5)
    return true
end

